function Header() {
    return (
        <div className = "container">
            <div className = "row">
                <div className = "header-name" href="/" style={{
                color: "#6d98ba",
                paddingLeft: "15px"
            }}>Error and Log Management</div>
                1 of 3
                </div>
                <div className = "col-6">
                2 of 3 (wider)
                </div>
                <div className = "col">
                3 of 3
                </div>
            </div>

    )
}
export default Header;
